from itertools import product
def h(w, x): return sum(1 for wi, xi in zip(w, x) if wi != xi)
def ok(w):
    return any(h(w, w[s:]+w[:s]) == 2 for s in range(1, len(w)))
def a(n):
    return 2*sum(1 for p in product("01", repeat=n-1) if ok("0"+"".join(p)))
